INSERT INTO vocabularies VALUES('http://www.europeana.eu/schemas/edm/','edm','2019-03-02 21:01:44',NULL,1,'Europeana Data Model (EDM) Vocabulary','The Europeana Data Model (EDM) is aimed at being an integration medium for collecting, connecting and enriching the descriptions provided by Europeana data providers. The RDF vocabulary for http://www.europeana.eu/schemas/edm/ defines the elements introduced by EDM (as opposed to the ones EDM re-uses from other namespaces).',NULL,NULL);
INSERT INTO vocabularies VALUES('http://www.w3.org/2003/12/exif/ns#','exif','2019-03-02 21:01:44',NULL,1,'Exif Vocabulary','Vocabulary to describe an Exif format picture data. All Exif 2.2 tags are defined as RDF properties, as well as several terms to help this schema.',NULL,NULL);
INSERT INTO vocabularies VALUES('http://www.w3.org/2004/02/skos/core#','skos','2019-02-20 20:51:13',NULL,1,'SKOS Vocabulary','An RDF vocabulary for describing the basic structure and content of concept schemes such as thesauri, classification schemes, subject heading lists, taxonomies, ''folksonomies'', other types of controlled vocabulary, and also concept schemes embedded in glossaries and terminologies.',NULL,NULL);
INSERT INTO vocabularies VALUES('http://ns.adobe.com/xap/1.0/','xmp','2019-03-02 21:01:44',NULL,1,'XMP Vocabulary','The Extensible Metadata Platform (XMP) basic namespace contains properties that provide basic descriptive information.',NULL,NULL);
INSERT INTO vocabularies VALUES('http://ns.adobe.com/xap/1.0/rights/','xmpRights','2019-03-02 21:01:44',NULL,1,'XMP Rights Management','The  XMP  Rights  Management  namespace  contains  properties  that  provide  information  regarding  the  legalrestrictions associated with a resource.',NULL,NULL);
INSERT INTO vocabularies VALUES('http://ns.adobe.com/xap/1.0/mm/','xmpMM','2019-03-02 21:01:44',NULL,1,'XMP Media Management','The  XMP  Media  Management  namespace  contains  properties  that  provide  information  regarding  theidentification, composition, and history of a resource.',NULL,NULL);
