INSERT INTO vocabularies VALUES('http://iptc.org/std/Iptc4xmpCore/1.0/xmlns/','Iptc4xmpCore','2019-03-02 21:01:44',NULL,1,'IPTC Core Vocabulary','IPTC Photo Metadata provides data about photographs and the values can be processed by software. Each individual metadata entity is called a property and they are grouped into Administrative, Descriptive and Rights-related properties. The IPTC Core schema which is built from properties of the IPTC “Information Interchange Model” (IIM) standard.',NULL,NULL);
INSERT INTO vocabularies VALUES('http://iptc.org/std/Iptc4xmpExt/2008-02-29/','Iptc4xmpExt','2019-03-02 21:01:44',NULL,1,'IPTC Extension Vocabulary','The IPTC Extension schema defines the semantics of a set of metadata properties and their technical expressions by the XMP format.',NULL,NULL);
