INSERT INTO properties VALUES('http://purl.org/dc/elements/1.1/date','http://purl.org/dc/elements/1.1/',NULL,NULL,NULL,'Date may be used to express temporal information at any level of granularity.  Recommended best practice is to use an encoding scheme, such as the W3CDTF profile of ISO 8601 [W3CDTF].','A point or period of time associated with an event in the lifecycle of the resource.');
INSERT INTO properties VALUES('http://purl.org/dc/elements/1.1/description','http://purl.org/dc/elements/1.1/',NULL,NULL,NULL,'Description may include but is not limited to: an abstract, a table of contents, a graphical representation, or a free-text account of the resource.','An account of the resource.');
INSERT INTO properties VALUES('http://purl.org/dc/elements/1.1/format','http://purl.org/dc/elements/1.1/',NULL,NULL,NULL,'Examples of dimensions include size and duration. Recommended best practice is to use a controlled vocabulary such as the list of Internet Media Types [MIME].','The file format, physical medium, or dimensions of the resource.');
