INSERT INTO properties VALUES('http://purl.org/dc/terms/provenance','http://purl.org/dc/terms/',NULL,NULL,NULL,'The statement may include a description of any changes successive custodians made to the resource.','A statement of any changes in ownership and custody of the resource since its creation that are significant for its authenticity, integrity, and interpretation.');
INSERT INTO properties VALUES('http://purl.org/dc/terms/references','http://purl.org/dc/terms/',NULL,NULL,NULL,NULL,'A related resource that is referenced, cited, or otherwise pointed to by the described resource.');
INSERT INTO properties VALUES('http://purl.org/dc/terms/replaces','http://purl.org/dc/terms/',NULL,NULL,NULL,NULL,'A related resource that is supplanted, displaced, or superseded by the described resource.');
INSERT INTO properties VALUES('http://purl.org/dc/terms/requires','http://purl.org/dc/terms/',NULL,NULL,NULL,NULL,'A related resource that is required by the described resource to support its function, delivery, or coherence.');
INSERT INTO properties VALUES('http://purl.org/dc/terms/rightsHolder','http://purl.org/dc/terms/',NULL,NULL,NULL,NULL,'A person or organization owning or managing rights over the resource.');
INSERT INTO properties VALUES('http://purl.org/dc/terms/source','http://purl.org/dc/terms/',NULL,NULL,NULL,'The described resource may be derived from the related resource in whole or in part. Recommended best practice is to identify the related resource by means of a string conforming to a formal identification system.','A related resource from which the described resource is derived.');
INSERT INTO properties VALUES('http://purl.org/dc/terms/spatial','http://purl.org/dc/terms/',NULL,NULL,NULL,NULL,'Spatial characteristics of the resource.');
INSERT INTO properties VALUES('http://purl.org/dc/terms/subject','http://purl.org/dc/terms/',NULL,NULL,NULL,'Typically, the subject will be represented using keywords, key phrases, or classification codes. Recommended best practice is to use a controlled vocabulary.','The topic of the resource.');
INSERT INTO properties VALUES('http://purl.org/dc/terms/tableOfContents','http://purl.org/dc/terms/',NULL,NULL,NULL,NULL,'A list of subunits of the resource.');
INSERT INTO properties VALUES('http://purl.org/dc/terms/temporal','http://purl.org/dc/terms/',NULL,NULL,NULL,NULL,'Temporal characteristics of the resource.');
INSERT INTO properties VALUES('http://purl.org/dc/terms/type','http://purl.org/dc/terms/',NULL,NULL,NULL,'Recommended best practice is to use a controlled vocabulary such as the DCMI Type Vocabulary [DCMITYPE]. To describe the file format, physical medium, or dimensions of the resource, use the Format element.','The nature or genre of the resource.');
INSERT INTO properties VALUES('http://purl.org/dc/terms/valid','http://purl.org/dc/terms/',NULL,NULL,NULL,NULL,'Date (often a range) of validity of a resource.');
INSERT INTO properties VALUES('http://www.w3.org/1999/02/22-rdf-syntax-ns#type','http://www.w3.org/1999/02/22-rdf-syntax-ns#',NULL,NULL,NULL,NULL,'The subject is an instance of a class.');
INSERT INTO properties VALUES('http://www.w3.org/1999/02/22-rdf-syntax-ns#subject','http://www.w3.org/1999/02/22-rdf-syntax-ns#',NULL,NULL,NULL,NULL,'The subject of the subject RDF statement.');
INSERT INTO properties VALUES('http://www.w3.org/1999/02/22-rdf-syntax-ns#predicate','http://www.w3.org/1999/02/22-rdf-syntax-ns#',NULL,NULL,NULL,NULL,'The predicate of the subject RDF statement.');
INSERT INTO properties VALUES('http://www.w3.org/1999/02/22-rdf-syntax-ns#object','http://www.w3.org/1999/02/22-rdf-syntax-ns#',NULL,NULL,NULL,NULL,'The object of the subject RDF statement.');
INSERT INTO properties VALUES('http://www.w3.org/1999/02/22-rdf-syntax-ns#value','http://www.w3.org/1999/02/22-rdf-syntax-ns#',NULL,NULL,NULL,NULL,'Idiomatic property used for structured values.');
INSERT INTO properties VALUES('http://www.w3.org/1999/02/22-rdf-syntax-ns#first','http://www.w3.org/1999/02/22-rdf-syntax-ns#',NULL,NULL,NULL,NULL,'The first item in the subject RDF list.');
INSERT INTO properties VALUES('http://www.w3.org/1999/02/22-rdf-syntax-ns#rest','http://www.w3.org/1999/02/22-rdf-syntax-ns#',NULL,NULL,NULL,NULL,'The rest of the subject RDF list after the first item.');
INSERT INTO properties VALUES('http://www.w3.org/2000/01/rdf-schema#isDefinedBy','http://www.w3.org/2000/01/rdf-schema#',NULL,NULL,NULL,NULL,'The defininition of the subject resource.');
INSERT INTO properties VALUES('http://www.w3.org/2000/01/rdf-schema#label','http://www.w3.org/2000/01/rdf-schema#',NULL,NULL,NULL,NULL,'A human-readable name for the subject.');
INSERT INTO properties VALUES('http://www.w3.org/2000/01/rdf-schema#comment','http://www.w3.org/2000/01/rdf-schema#',NULL,NULL,NULL,NULL,'A description of the subject resource.');
INSERT INTO properties VALUES('http://www.w3.org/2000/01/rdf-schema#subClassOf','http://www.w3.org/2000/01/rdf-schema#',NULL,NULL,NULL,NULL,'The subject is a subclass of a class.');
