INSERT INTO properties VALUES('http://www.w3.org/2000/01/rdf-schema#subPropertyOf','http://www.w3.org/2000/01/rdf-schema#',NULL,NULL,NULL,NULL,'The subject is a subproperty of a property.');
INSERT INTO properties VALUES('http://www.w3.org/2000/01/rdf-schema#seeAlso','http://www.w3.org/2000/01/rdf-schema#',NULL,NULL,NULL,NULL,'Further information about the subject resource.');
