INSERT INTO properties VALUES('http://www.openarchives.org/ore/terms/aggregates','http://www.openarchives.org/ore/terms/',NULL,NULL,NULL,NULL,'Aggregations, by definition, aggregate resources. The ore:aggregates relationship expresses that the object resource is a member of the set of Aggregated Resources of the subject (the Aggregation). This relationship between the Aggregation and its Aggregated Resources is thus more specific than a simple part/whole relationship, as expressed by dcterms:hasPart for example.');
INSERT INTO properties VALUES('http://www.openarchives.org/ore/terms/isAggregatedBy','http://www.openarchives.org/ore/terms/',NULL,NULL,NULL,NULL,'The inverse relationship of ore:aggregates, ore:isAggregatedBy asserts that an Aggregated Resource is aggregated by an Aggregation.');
INSERT INTO properties VALUES('http://www.openarchives.org/ore/terms/describes','http://www.openarchives.org/ore/terms/',NULL,NULL,NULL,NULL,'This relationship asserts that the subject (a Resource Map) describes the object (an Aggregation).');
INSERT INTO properties VALUES('http://www.openarchives.org/ore/terms/isDescribedBy','http://www.openarchives.org/ore/terms/',NULL,NULL,NULL,NULL,'The inverse relationship of ore:describes, in this case the object of the relationship is the Resource Map and the subject is the Aggregation which it describes.');
INSERT INTO properties VALUES('http://www.openarchives.org/ore/terms/lineage','http://www.openarchives.org/ore/terms/',NULL,NULL,NULL,NULL,'ore:lineage is a relationship between two Proxy objects, both of which MUST have the same Resource for which they are proxies. The meaning is that the Resource for which the subject of the relationship is a Proxy was discovered in the Aggregation in which the object Proxy''s resource is aggregated.');
INSERT INTO properties VALUES('http://www.openarchives.org/ore/terms/proxyFor','http://www.openarchives.org/ore/terms/',NULL,NULL,NULL,NULL,'Proxy objects are used to represent a Resource as it is aggregated in a particular Aggregation. The ore:proxyFor relationship is used to link the proxy to the Aggregated Resource it is a proxy for. The subject of the relationship is a Proxy object, and the object of the relationship is the Aggregated Resource.');
INSERT INTO properties VALUES('http://www.openarchives.org/ore/terms/proxyIn','http://www.openarchives.org/ore/terms/',NULL,NULL,NULL,NULL,'Proxy objects must link to the Aggregation in which the resource being proxied is aggregated. The ore:proxyIn relationship is used for this purpose. The subject of the relationship is a Proxy object, and the object of the relationship is the Aggregation.');
INSERT INTO properties VALUES('http://www.openarchives.org/ore/terms/similarTo','http://www.openarchives.org/ore/terms/',NULL,NULL,NULL,NULL,'The subject of this relationship MUST be an Aggregation.  This Aggregation should be considered an expression within the ORE context of the object of the relationship, as it is broadly equivalent to the resource. For example, the Aggregation may consist of the resources which, together, make up a journal article which has a DOI assigned to it. The Aggregation is not the article to which the DOI was assigned, but is a representation of it in some manner.');
